import React from 'react';
import {View , Text , StyleSheet , Button} from 'react-native';
import { HeaderButtons, Item } from 'react-navigation-header-buttons';
import {Avatar} from 'react-native-elements';
import HeaderButton from '../components/HeaderButton';
import Card from '../components/Card';
import CategoryGridTile from '../components/CategoryGridStyle';

const HomeScreen = props => {
    return(
        <View style={styles.home}>
          <Card style= {styles.buttonConatiner}>
              <Text style={styles.Text1}>Medius</Text>
              <Text style={styles.Text2}>Marium Adnan</Text>
              <View>
              <Avatar
               size={120}
              overlayContainerStyle={{backgroundColor: '#d8d8d8' , left:220 , bottom:100}}
              rounded
              source={require('../assets/avatar.png')}
               />
               </View>
          </Card>
          <CategoryGridTile />
           

        </View>
    );

};

HomeScreen.navigationOptions = navData => {
    return {
      headerTitle: 'Home',
      headerLeft: (
        <HeaderButtons HeaderButtonComponent={HeaderButton}>
          <Item
        
            title="Menu"
            iconName="ios-menu"
            color='black'
            onPress={() => {
              navData.navigation.toggleDrawer();
            }}
          />
        </HeaderButtons>
      ),
      headerRight: (
        <HeaderButtons HeaderButtonComponent={HeaderButton}>
           <Item
           title="Notification"
           iconName="md-notifications-outline"
           color='black'
           onPress={() => {
            navData.navigation.navigate({routeName: 'Setting'});
        }} />
           
          <Avatar
           size="small"
           overlayContainerStyle={{backgroundColor: 'orange'}}
           rounded
           title="US"
           onPress={() => console.log("Works!")}
           activeOpacity={0.1}
           containerStyle={{flex: 1, marginRight: 10}}
          
          />
            {/* <FontAwesome5 
          
          name="user-circle"
          color='black'
          size={23}
          onPress={() => {
           console.log('My profile')
          }}
          /> */}
         
          
         
          </HeaderButtons>
      )
    };
  };
  

const styles = StyleSheet.create({
    home:{
        // flex: 1,
        marginTop: 20,
        marginRight: 20,
        marginLeft: 20,
    },
    buttonConatiner: {
       height: 150,
  },
    Text1: {
      alignItems: 'flex-start',
      fontSize: 34,
      color: '#bbbbbb',
      fontWeight: 'bold'
    },
    Text2: {
      paddingTop: 10,
      alignItems: 'flex-start',
      fontSize: 24,
      color: '#bbbbbb',

    },
    avatars:{
      flex: 1,
      flexDirection:'row',
      // justifyContent: 'fle',
     
    }
});

export default HomeScreen;
